import React, { Component } from 'react';
import Profile from './Profile';

class HomeComponent extends Component{

    state ={
        name: 'Francis',
        lastName: 'Jones',
        age: 23,
        hobbies:['running', 'jumping']
    }
    render(){
        return(
            <>
                <Profile {...this.state}/>
            </>

        )
    }
}


export default HomeComponent;
